declare namespace xpt='http://marklogic.com/XPathTest'

try { let $count := fn:count(for $x  in fn:doc('/xpathtest/normal.xml')//xpt:token where $x/. lt xs:token('aToken1') return $x)
return
   try {
      let $estimate := xdmp:estimate(for $x  in fn:doc('/xpathtest/normal.xml')//xpt:token where $x/. lt xs:token('aToken1') return $x) return
      if (0= $count and 1= $estimate )
      then fn:true() else
      ('type_token_slash-slash-token_dot_lt_aToken1_doc.normal_where for $x  in fn:doc("/xpathtest/normal.xml")//xpt:token where $x/. lt xs:token("aToken1") return $x: ',
      'count=', $count, ' estimate=', $estimate, '
'
      )
   } catch ($e) {
      if (fn:false()) then
      ('type_token_slash-slash-token_dot_lt_aToken1_doc.normal_where for $x  in fn:doc("/xpathtest/normal.xml")//xpt:token where $x/. lt xs:token("aToken1") return $x: ',
      'count=', $count, ' error=', $e/*:message/text(), '
'
      )
      else
      if (0= $count)
      then fn:true() else
      ('type_token_slash-slash-token_dot_lt_aToken1_doc.normal_where for $x  in fn:doc("/xpathtest/normal.xml")//xpt:token where $x/. lt xs:token("aToken1") return $x: ',
      'count=', $count, ' not estimatable
'
      )
   }
} catch ($e) {
      ('type_token_slash-slash-token_dot_lt_aToken1_doc.normal_where for $x  in fn:doc("/xpathtest/normal.xml")//xpt:token where $x/. lt xs:token("aToken1") return $x: ',
      'error=', $e/*:message/text(), '
'
      )
}
